import ast

def decrypt(cipher):
    hex_list = []
    for group in cipher:
        for item in group:
            if isinstance(item, str) and item.startswith("0x"):
                hex_list.append(item)
    flag = ''.join(chr(int(h, 16)) for h in hex_list)
    return flag


